def test_gradient_spect_1D():
    # compute gradient of a 2 period sinusoid
    x = np.arange(start=np.pi / 20, stop=4 * np.pi + np.pi / 20, step=np.pi / 20)
    y = np.sin(x)
    dydx = gradient_spect(y, np.pi / 20)
    test_val = np.cos(x)

    assert np.isclose(dydx, test_val).all()


